(339, '', '', '', '', '', '', 'Graduate', 'BCA', '', '', '1', 'Our company is hiring Technical Research Analyst .Qualification:- Graduate. Salary :- 15,000/- to 20,000/- per month. Skills:- You should have specialization in finance. Invest your initial years in understanding the markets and practising technical analysis. International  Stock market knowledge, Expert in analysis, Fundamental & technical Chart.  Limited seats Interested candidates apply fast. For more details contact us or visit our office at Sh-18 hig colony oppo. Mangal city mall vijay nagar, Indore.', '2019-07-12 11:43:59'),
