(341, '', '', '', '', '', '', '10th', '', '', '', '1', 'We are hiring for Field Executive for Opening Kotak Mahindra zero balance account .Qualification:- 10th/12th. Salary:- As per negotiation. Skills:- Excellent communication skills, Can do approach, willingness to do, smart worker.\nInterested candidate apply fast . Visit our office with your resume at Sh-18 Hig colony, oppo. Mangal city mall vijay nagar, Indore.Timing 11 am to 5 pm.', '2019-07-12 12:04:44'),
(342, '', '', '', '', '', '', 'Graduate', 'BCom', '', '', '1', 'We are hiring for Content Writer. Salary:- As per knowledge  and qualification. Qualification:- Graduation. Experience:- 1 to 2 years. Key skills:-Excellent English writing skills with command over grammar and vocabulary, Familiarity with Internet and search engines, Clear, concise and compelling copy writing and proofreading skills. If you are interested apply fast or contact us at 8770615331 or visit our office with your resume at sh-18 hig colony, opposite mangal city mall vijay nagar Indore. ', '2019-07-12 14:22:58'),
